import React from 'react';
import { Form, Card, Container } from 'react-bootstrap';

const Auth = () => {
    return (
        
        <Container 
            style={{height:200, justifyContent:'center', alignItems:'center', display:'flex'}}
        >
            <Card  style={{width:600, padding:5, color:'black', justifyContent:'center'}}>
                <h2  >Authorization</h2>   
                <Form style={{width:600, padding:5, color:'black', display:'flex',flex:'column'}}>
                    <Form.Control 
                        style={{marginTop:5, display:'flex'}}
                        placeholder="Enter an email"
                    />
                    <Form.Control 
                        style={{marginTop:5}}
                        placeholder="Enter a password"
                    />
                </Form>
            </Card>
            
        </Container>
    );
};

export default Auth;
